import logo from './logo.svg';
import './App.css';

function App() {
  function unique(arr) {
    let result = [];
    new Set(arr).forEach(i => result.push(i));
    return result
  }

  let values = ["Hare", "Krishna", "Hare", "Krishna",
    "Krishna", "Krishna", "Hare", "Hare", ":-O"
  ];

  console.log(unique(values)); // Hare,Krishna,:-O
  return (
    <div className="App">

    </div>
  );
}

export default App;
